import React, { useState } from 'react'
import MyButton from '../UI/Button/MyButton';
import MyInput2 from '../UI/Input/MyInput2';

const NewNam = ({ create }) => {
    const [dela, setDela] = useState({ nam: '', title: '', main: '' });
    return (
        <div>
            <div style={{ display: "flex", flexDirection: "column", alignItems: "end", width: '274px' }}>
                <MyInput2
                    title={"Собитие"}
                    value={dela.nam}
                    onChange={e => setDela({ ...dela, nam: e.targer.value })}
                />
                <MyInput2
                    title={"Название"}
                    value={dela.title}
                    onChange={e => setDela({ ...dela, title: e.targer.value })}
                />
                <MyInput2
                    title={"Описание"}
                    value={dela.main}
                    onChange={e => setDela({ ...dela, main: e.targer.value })}

                />
            </div>
            <MyButton
                onClick={() => {

                }}
            >Добавить</MyButton>
        </div>
    )
}

export default NewNam
